// import './main.css';


import React from "react";

import groceries from './images/stock/groceries1.png'


function Stock() {
  return (        
    <main className='container top2'>
        <div className='row left'>
            <h5 className='col'>Stock</h5>
        </div>

        <div className='row border top2'>
              <button className='col left'>
                    <img className='button-img' src={groceries} alt="groceries"></img>

              </button>

        </div>


    </main>            
  );
}

export default Stock;
